import React from 'react';

import Card from '../../UI/Card';

const User = props => {
  return (
    <Card className='expense-user'>
      <div className='expense-user__name'>
        <h2>{props.name}</h2>
        <div className='expense-user__age'>${props.age}</div>
      </div>
    </Card>
  );

};

export default User;
